import {AppBar, Button, Grid, IconButton, Toolbar, Typography} from '@material-ui/core';
import React, {FunctionComponent} from 'react';
import './header.css';
import BgImg from "./assets/solana_school_front.png";

const GridSchool: FunctionComponent = ()=>{

    return (
        <Grid   container
                direction="column"
                className="gridSchoolContainer">
            <div style={{
                backgroundImage: `url(`+{BgImg}+`)`
            }}>
                Hello World
            </div>
        </Grid>
    );
}

export default GridSchool;
